import React from 'react';
import { data } from './database';
import useSound from 'use-sound';
import soundfile from './bird_chirp.wav';
import './AccessibleCaptchaStyle.css';

function AccessibleCaptcha() {
  const [play] = useSound(soundfile);
  return (
    <React.Fragment>

      <p>{data[0].question}</p>
      <div className="captchaMedia flex justify-center">  
        <button onClick={play} className="br3">Sound</button>
        <img src={data[0].image_file} className="br3"></img>
      </div>

    </React.Fragment>
  );
}

export default AccessibleCaptcha;
